// import React from "react";
import { useState } from "react";


function Todo(props) {
   const [isDone, setisdone] = useState(false);


   function clicked() {
      setisdone(prevValue => {
         return !prevValue;
      });
   }
   return (
         <li onClick={clicked} style={{ textDecoration: isDone ? null :null }}>{props.text}</li>
   )
}
export default Todo;
